import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Wait for min and max price inputs
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min price to 100
    const minInput = await page.$('#minPrice');
    await minInput.click({ clickCount: 3 });
    await minInput.type('100');

    // Set max price to 500
    const maxInput = await page.$('#maxPrice');
    await maxInput.click({ clickCount: 3 });
    await maxInput.type('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_entered.png'));

    // Click the Apply button
    const applyBtn = await page.$('.apply-filter');
    await applyBtn.click();

    // Wait for products grid/list to update (look for product cards)
    // We'll wait for at least one product-card to be visible
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract product titles and prices visible after filter
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract price as number
        const match = priceText.match(/\$([0-9,.]+)/);
        const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter out products with price not in range (shouldn't be needed, but double-check)
    const filteredProducts = products.filter(p => p.price !== null && p.price >= 100 && p.price <= 500);

    return {
      success: true,
      action: "Applied price range filter (min $100, max $500) and extracted filtered product data",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
